package com.afcarrasquilla.mygamelist;

import android.content.Context;

import androidx.test.platform.app.InstrumentationRegistry;
import androidx.test.ext.junit.runners.AndroidJUnit4;

import com.afcarrasquilla.mygamelist.models.Juego;
import com.afcarrasquilla.mygamelist.models.JuegoModelo;

import org.junit.After;
import org.junit.Before;
import org.junit.Test;
import org.junit.runner.RunWith;

import java.util.ArrayList;

import static org.junit.Assert.*;

/**
 * Instrumented test, which will execute on an Android device.
 *
 * @see <a href="http://d.android.com/tools/testing">Testing documentation</a>
 */
@RunWith(AndroidJUnit4.class)
public class ModelUnitTest {

    private JuegoModelo model;
    public Juego juegoPrueba, juegoPrueba2;

    @Before
    public void setUp() {
        InstrumentationRegistry.getInstrumentation().getTargetContext().deleteDatabase("MyGameList");
        model = JuegoModelo.getInstance();

        juegoPrueba = new Juego();
        juegoPrueba.setId(11);
        juegoPrueba.setName("Ejemplo");
        juegoPrueba.setCompany("Ejemplo");
        juegoPrueba.setHours(15);
        juegoPrueba.setDate("15/11/2019");
        juegoPrueba.setPlatform("SWITCH");
        juegoPrueba.setProperty(true);
        juegoPrueba.setImage("");

        juegoPrueba2 = new Juego();
        juegoPrueba2.setId(12);
        juegoPrueba2.setName("Ejemplo2");
        juegoPrueba2.setCompany("Ejemplo2");
        juegoPrueba2.setHours(15);
        juegoPrueba2.setDate("15/11/2019");
        juegoPrueba2.setPlatform("SWITCH");
        juegoPrueba2.setProperty(true);

    }

    @After
    public void tearDown() {
        model.close();
    }

    @Test
    public void insertJuegoTest(){
        assertEquals(true, model.addNew(juegoPrueba));
        assertEquals(true, model.addNew(juegoPrueba2));
        assertEquals(false, model.addNew(null));
        assertEquals(false, model.addNew(new Juego()));
    }



    @Test
    public void modifyJuegoTest(){
        model.addNew(juegoPrueba);
        Juego juego = model.getGame(11);
        assertEquals("Ejemplo", juego.getName());
        juego.setName("asdf");
        model.modifyGame(juego);
        Juego juegoCambiado = model.getGame(11);
        assertEquals("asdf", juegoCambiado.getName());
    }

    @Test
    public void getJuegoTest(){
        model.addNew(juegoPrueba);
        model.addNew(juegoPrueba2);
        assertEquals("Ejemplo2", model.getGame(12).getName());
        assertEquals("SWITCH", model.getGame(11).getPlatform());
    }

    @Test
    public void getJuegosTest(){
        model.addNew(juegoPrueba);
        model.addNew(juegoPrueba2);
        ArrayList<Juego> juegos = model.getAllGames();
        assertEquals(12, juegos.size());
    }

    @Test
    public void deleteJuegoTest(){
        model.addNew(juegoPrueba);
        model.addNew(juegoPrueba2);
        assertTrue(model.deleteGame(juegoPrueba.getId()));
        assertTrue(model.deleteGame(juegoPrueba2.getId()));
    }

    @Test
    public void searchJuegosTest(){
        String[] s1 = {"%%", "%%", "%1%", "%2%", "%%"};
        ArrayList<Juego> juegos = model.searchGames(s1);
        assertEquals(7, juegos.size());
        String[] s2 = {"%Pokemon%", "%%", "%%", "%%", "%%"};
        juegos = model.searchGames(s2);
        assertEquals(2, juegos.size());
    }

    @Test
    public void CRUDPlatformTest(){
        assertEquals(true, model.addPlatform("Ejemplo"));
        assertEquals(6, model.getAllPlatforms().size());
    }

}

